    "opcode": "JMP",
    "argument": "$FE34",
    "comment": "read/set the bottom of memory",
    "desc": "read/set the bottom of memory this routine is used to read and set the bottom of RAM. When this routine is called with the carry bit set the pointer to the bottom of RAM will be loaded into XY. When this routine is called with the carry bit clear XY will be saved as the bottom of memory pointer changing the bottom of memory.",
    "parent": "this",
